import React from "react";
import Cuadrito from "./Cuadrito";

function Fila(props){

    let cuadritos = [];

    for(let i = 0; i < 10; i++){
        cuadritos.push(<Cuadrito key = {i} selectedColor={props.selectedColor}/>)
    }
    return <div className="row"></div>
}
export default Fila;
